import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Link, Navigate  } from 'react-router-dom';
import TaskForm from './TaskForm';
import TaskList from './TaskList';
import Login from './Login';
import './style.css';
import axios from 'axios';
import Cookies from 'js-cookie';

function App() {
  const [tasks, setTasks] = useState([]);
  const [isAdminLoggedIn, setIsAdminLoggedIn] = useState(Cookies.get('Admin') != null);

  useEffect(() => {
    setIsAdminLoggedIn(Cookies.get('Admin') != null);
  }, []);

  const handleLogout = () => {
    Cookies.remove('Admin');
    setIsAdminLoggedIn(false);
  };

  const handleSubmit = async (title, description, due_date) => {
    const response = await axios.post('http://localhost:8000/tasks/', { title, description, due_date });
    setTasks([...tasks, response.data]);
   };

  return (
    <Router>
      <div className="App container mt-5">
        <Link to="/" className='ms-4'>



<div class="container">
    <header class="d-flex flex-wrap align-items-center justify-content-center justify-content-md-between py-3 mb-4 border-bottom">
      <div class="col-md-3 mb-2 mb-md-0">
        <a href="/" class="d-inline-flex link-body-emphasis text-decoration-none fs-1">
          <img src="https://i.pinimg.com/originals/89/f6/d8/89f6d83268c3220a06253acb858706b8.png" width={100+'px'} />
        </a>
      </div>

      <ul class="nav col-12 col-md-auto mb-2 justify-content-center mb-md-0">
        <li><h4 class=" px-2 ">Task Management System</h4></li>
      </ul>


      {
            isAdminLoggedIn ? 
            <div class="col-md-3 text-end">
            <button type="button" class="btn btn-outline-primary me-2" onClick={handleLogout}>Logout</button>
          </div>
           : 
            <div class="col-md-3 text-end">
            <button type="button" class="btn btn-outline-primary me-2">Login</button>
            <button type="button" class="btn btn-primary">Sign-up</button>
          </div>
          }
    </header>
  </div>

  <div class="background">
        <div class="shape"></div>
        <div class="shape"></div>
    </div>
    <form>
        <h3>Login Here</h3>

        <label for="username">Username</label>
        <input type="text" placeholder="Email or Phone" id="username"/>

        <label for="password">Password</label>
        <input type="password" placeholder="Password" id="password"/>

        <button>Log In</button>
        <div class="social">
          <div class="go"><i class="fab fa-google"></i>  Google</div>
          <div class="fb"><i class="fab fa-facebook"></i>  Facebook</div>
        </div>
    </form>
        </Link>

        <Routes>
          <Route path="/" element={isAdminLoggedIn ? <Navigate to="/tasks" /> : <Login />} />
          <Route path="/tasks" element={isAdminLoggedIn ?
            <>
              <TaskForm onSubmit={handleSubmit} />
              <TaskList tasks={tasks} />
            </>
            : <Navigate to="/" />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
